import React, { useState, useEffect } from 'react';
import './TrackList.css';
import Track from '../Track/Track';

function TrackList({searchResults, onAdd}, props) {

    return (
        <div className="TrackList">
            {searchResults.map(
                searchResultObject => <Track key={searchResultObject.id} searchResultObject={searchResultObject} onAdd={tr => onAdd(tr)} />)}
        </div>
    )
}

export default TrackList;
